import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <table>
        <tr>
          <th>Name</th>
          <th>Age</th>
        </tr>
        <tr>
          <td>Naveen</td>
          <td>25</td>
        </tr>
        <tr>
          <td>Sunil</td>
          <td>24</td>
        </tr>
      </table>
    </div>
  );
}

export default App;
